import React, { useEffect, useState } from 'react';
import AlertIcon from './Pictures/Alert-image.png';
import './ChimneyServices.css';
import './Home.css';
import ChimneyServiceImage1 from './Pictures/Picture37.jpg';
import pic1 from './Pictures/Picture37.jpg';
import BrickFAQ from './BrickFAQ';
import GetInTouch from './GetInTouch';

const ChimneyServices = () => {
  const [showBackToTop, setShowBackToTop] = useState(false);
  const [showAlert, setShowAlert] = useState(false);

  useEffect(() => {
    // Disable right-click
    document.addEventListener('contextmenu', event => event.preventDefault());

    // Disable text selection
    document.addEventListener('selectstart', event => event.preventDefault());

    // Disable copy
    document.addEventListener('copy', event => event.preventDefault());

    // Disable certain keyboard shortcuts
    const handleKeyDown = (event) => {
      if (event.ctrlKey && (event.key === 'c' || event.key === 'u' || event.key === 's' || event.key === 'a')) {
        event.preventDefault();
      }
    };

    const handleDoubleClick = () => {
      setShowAlert(true);
      setTimeout(() => {
        setShowAlert(false);
      }, 3000); // Hide alert after 3 seconds
    };

    document.addEventListener('keydown', handleKeyDown);
    document.addEventListener('dblclick', handleDoubleClick);

    // Show/Hide "Back to Top" button
    const handleScroll = () => {
      if (window.scrollY > 200) {
        setShowBackToTop(true);
      } else {
        setShowBackToTop(false);
      }
    };

    window.addEventListener('scroll', handleScroll);

    return () => {
      document.removeEventListener('contextmenu', event => event.preventDefault());
      document.removeEventListener('selectstart', event => event.preventDefault());
      document.removeEventListener('copy', event => event.preventDefault());
      document.removeEventListener('keydown', handleKeyDown);
      document.removeEventListener('dblclick', handleDoubleClick);
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <div>
      {showAlert && (
        <div className="alert">
          <img src={AlertIcon} alt="Alert Icon" />
          <span>ALERT: Content is protected !!</span>
        </div>
      )}
      <section className="Chimney-services">
        <div className="Chimney-services__overlay">
          <h1 className="Chimney-services__title">Chimney Services</h1>
          <p className="Chimney-services__subtitle">Building Excellence with Integrity and Innovation</p>
        </div>
      </section>

      <div className="Chimney-services-container">
        <div className="Chimney-services-image-container">
          <img src={pic1} alt="Chimney-services Work" className="Chimney-services-image" />
        </div>
        <div className="Chimney-services-text-container">
          <h1>Brick Tech Contracting Corp: Your Solution for Brick Pointing in New York City</h1>
          <p>Welcome to Brick Tech Contracting Corp, your one-stop construction service provider for all your brick pointing needs in New York City. We specialize in providing high-quality, affordable brick pointing services in NYC for residential and commercial properties. Our team of expert masons has years of experience in the industry, and we are committed to delivering the best possible results for every project we undertake.</p>
        </div>
      </div>

      <div className="Chimney-services-container">
        <div className="Chimney-services-section">
          <div className="images-container-Chimney-services">
            <img src={ChimneyServiceImage1} alt="Chimney-services" className="Chimney-services-image" />
          </div>
          <div className="text-container-Chimney-services">
            <h1>Asphalt Shingle Roofing Installation</h1>
            <p>Asphalt shingles are one of the most popular roofing materials in NYC due to their affordability, versatility, and durability. Our team has installed countless asphalt shingle roofs over the years, using the latest techniques and materials to ensure that your new roof looks great and provides reliable protection for your home.</p>
          </div>
        </div>
      </div>
      <div>
        <BrickFAQ />
      </div>
      <div>
        <GetInTouch />
      </div>

      {/* WhatsApp and Back to Top */}
      <div className="home__whatsapp">
        <a href="https://wa.me/yourphonenumber">
          <div className="whatsapp-icon-container">
            <i className="fab fa-whatsapp whatsapp-icon"></i>
          </div>
          <span>Need Help? <strong>Chat with us</strong></span>
        </a>
      </div>

      {/* Back to Top Button */}
      <div
        className={`home__back-to-top ${showBackToTop ? '' : 'hidden'}`}
        onClick={scrollToTop}
      >
        <i className="fa fa-arrow-up"></i>
      </div>
    </div>
  );
};

export default ChimneyServices;
